import "../style/pokedex.css";

function Pokedex() {
    let pokemon;

    fetch('https://pokeapi.co/api/v2/pokemon/1/')
    .then((response) => response.json())
    .then((data) => pokemon = data);

    console.log(pokemon.name);
    
    return (
        <div className="pokedex">
            <h1>Pokedex</h1>
        </div>
    );
}

export default Pokedex;
